import React from "react";
import { HStack, Button, Image, Link } from "@chakra-ui/react";

import LargeLogo from "./assets/logo-full-large.svg";

function MenuBar() {
  return (
    <HStack>
      <Image src={LargeLogo} />
      <HStack>
        <Link fontSize="lg">Home</Link>
        <Link>About</Link>
        <Button colorScheme="blue" bg="blue.900" size="md">
          Login
        </Button>
      </HStack>
    </HStack>
  );
}

export default MenuBar;
